  name: RouteValueDictionary
  nameWithType: RouteValueDictionary
  fullName: System.Web.Routing.RouteValueDictionary
  type: Class
  assemblies:
  - System.Web
  namespace: System.Web.Routing
  summary: Represents a case-insensitive collection of key/value pairs that you use in various places in the routing framework, such as when you define the default values for a route or when you generate a URL that is based on a route.
  remarks: "The <xref:System.Web.Routing.RouteValueDictionary> class enables you to work with collections of key/value pairs that are required in order to use ASP.NET routing. You use the <xref:System.Web.Routing.RouteValueDictionary> object to define values for the <xref:System.Web.Routing.Route.Constraints%2A>, <xref:System.Web.Routing.Route.DataTokens%2A>, and <xref:System.Web.Routing.Route.Defaults%2A> properties. You also use a <xref:System.Web.Routing.RouteValueDictionary> object when you generate a URL by calling the <xref:System.Web.Routing.RouteCollection.GetVirtualPath%2A> method and passing a <xref:System.Web.Routing.RouteValueDictionary> object as a parameter.  \n  \n Every key in a <xref:System.Web.Routing.RouteValueDictionary> object must be unique. The <xref:System.Web.Routing.RouteValueDictionary> class uses case-insensitive ordinal comparison. For more information, see <xref:System.StringComparer.OrdinalIgnoreCase%2A>. A key cannot be `null`."
  example:
  - "The following example shows how to create a <xref:System.Web.Routing.Route> object and how to set the <xref:System.Web.Routing.Route.Constraints%2A>, <xref:System.Web.Routing.Route.DataTokens%2A>, and <xref:System.Web.Routing.Route.Defaults%2A> properties.  \n  \n [!code-csharp[System.Web.Routing.Route.ctor#1](~/samples/snippets/csharp/VS_Snippets_WebNet/System.Web.Routing.Route.ctor/cs/Global.asax#1)]\n [!code-vb[System.Web.Routing.Route.ctor#1](~/samples/snippets/visualbasic/VS_Snippets_WebNet/System.Web.Routing.Route.ctor/VB/Global.asax#1)]"
